import React, { useState, useEffect, useRef } from "react";
import { View, Text, TouchableOpacity, Image } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { Camera } from "expo-camera";
import * as ImagePicker from "expo-image-picker";
import ShootingStyle from "./styles/ShootingStyle";
import facescan from "../../assets/image/face-scan.png";
import axios from "axios";

const Shooting = () => {
  const navigation = useNavigation();

  const [selectedFile, setSelectedFile] = useState(null);
  const [isOpenCamera, setIsOpenCamera] = useState(false);
  const [isCameraReady, setIsCameraReady] = useState(false);
  const [isCapturing, setIsCapturing] = useState(false);

  let cameraRef = useRef(null);

  const handleStartTesting = () => {
    if (!selectedFile) {
      alert("Please upload an image before testing.");
      return;
    }

    const formData = new FormData();
    formData.append("image", {
      uri: selectedFile,
      name: "image.jpg",
      type: "image/jpeg",
    });

    axios
      .post("http://192.168.100.5:5000/process", formData)
      .then((response) => {
        let result = response.data.predicted_class;
        navigation.navigate("Result", { imageUrl: selectedFile, result: result });
      })
      .catch((error) => {
        console.log(error);
      });
  };

  const handleTakePhoto = async () => {
    if (cameraRef.current) {
      // Kiểm tra nếu đang trong quá trình chụp ảnh
      if (isCapturing) {
        return;
      }

      // Đánh dấu đang trong quá trình chụp ảnh
      setIsCapturing(true);

      try {
        let photo = await cameraRef.current.takePictureAsync();
        setSelectedFile(photo.uri);
        setIsOpenCamera(false);
      } catch (error) {
        console.log(error);
      } finally {
        // Kết thúc quá trình chụp ảnh
        setIsCapturing(false);
      }
    }
  };

  const handleChooseFromGallery = async () => {
    try {
      let result = await ImagePicker.launchImageLibraryAsync({
        mediaTypes: ImagePicker.MediaTypeOptions.Images,
        allowsEditing: true,
        aspect: [4, 3],
        quality: 1,
      });

      if (!result.cancelled) {
        setSelectedFile(result.uri);
        setIsOpenCamera(false);
      } else {
        alert("No image selected.");
      }
    } catch (error) {
      // Xử lý lỗi ở đây
      console.log("Error selecting image from gallery:", error);
      // Hoặc có thể hiển thị một thông báo lỗi cho người dùng
      alert("An error occurred while selecting image from gallery.");
    }
  };

  const handleCameraReady = () => {
    setIsCameraReady(true);
  };

  useEffect(() => {
    const getCameraPermission = async () => {
      const { status } = await Camera.requestCameraPermissionsAsync();
      if (status !== "granted") {
        alert("Permission to access camera was denied.");
      }
    };
  
    getCameraPermission();
  }, []);  
  

  const toggleCamera = () => {
    setIsOpenCamera((prevState) => !prevState);
  };

  return (
    <View style={ShootingStyle.container}>
      <View style={ShootingStyle.topinfo}>
        <View style={ShootingStyle.row}>
          <View style={ShootingStyle.backmenu}>
            <TouchableOpacity onPress={() => navigation.goBack()}>
              <View style={ShootingStyle.rectangleA}>
                <Text style={ShootingStyle.icon}>⬅️</Text>
              </View>
            </TouchableOpacity>
          </View>
        </View>
        <View style={ShootingStyle.mainphoto}>
          <View style={ShootingStyle.content}>
            <View style={ShootingStyle.elipse2}>
              <View style={ShootingStyle.elipse}>
                {isOpenCamera ? (
                  <Camera
                    style={ShootingStyle.camera}
                    type={Camera.Constants.Type.back}
                    ref={cameraRef}
                    onCameraReady={handleCameraReady}
                    useCamera2Api={true}
                  >
                    <TouchableOpacity
                      onPress={() => {
                        toggleCamera();
                        handleTakePhoto();
                      }}
                      style={ShootingStyle.rectangleB}
                      disabled={isOpenCamera}
                    >
                      <Text style={ShootingStyle.icon}>📸</Text>
                    </TouchableOpacity>
                  </Camera>
                ) : selectedFile ? (
                  <Image
                    source={{ uri: selectedFile }}
                    style={ShootingStyle.selectedImage}
                  />
                ) : (
                  <Image
                    source={facescan}
                    style={ShootingStyle.defaultImage}
                  />
                )}
              </View>
            </View>
          </View>
        </View>
      </View>
      <View style={ShootingStyle.bottominfo}>
        <View style={ShootingStyle.buttonmenu}>
          <View style={ShootingStyle.upload}>
              <TouchableOpacity
                onPress={() => {
                  toggleCamera();
                  handleTakePhoto();
                }}
                style={ShootingStyle.rectangleB}
                disabled={!isCameraReady}
              >
                <Text style={ShootingStyle.icon}>📸</Text>
              </TouchableOpacity>
            <TouchableOpacity
              onPress={handleChooseFromGallery}
              style={ShootingStyle.rectangleB}
            >
              <Text style={ShootingStyle.icon}>🖼️</Text>
            </TouchableOpacity>
          </View>
          <View style={ShootingStyle.test}>
            <TouchableOpacity
              onPress={handleStartTesting}
              style={ShootingStyle.rectangleC}
            >
              <Text style={ShootingStyle.testText}>Start Testing</Text>
            </TouchableOpacity>
          </View>
        </View>
      </View>
    </View>
  );
};

export default Shooting;
